function [IM, surflap, surfgrad] = KPMDiffSurfMatrix(X, Z, surftype, varargin)
% by lxb;
% Version 2.0
% surftype:'Sphere','Torus','Bretzel2','Cyclide','CPD surface',;
% example:
% [Kmat,Lapmat,surfgrad] = KPMDiffSurfMatrix(X,Z,'Sphere',2);
% [Kmat,Lapmat] = KPMDiffSurfMatrix(X,Z,'Sphere');

global RBFscale;
dim = size(Z,2);
if dim == 3
    

    [nz,dim] = size(Z);
    nx = size(X,1);
    
    DMS = DistanceMatrixSquare(X,Z);

    IM = frbf(DMS*diag(RBFscale.^2),0);

    fmat1 = frbf(DMS*diag(RBFscale.^2),1)*diag(RBFscale.^2);
    fmat2 = frbf(DMS*diag(RBFscale.^2),2)*diag(RBFscale.^4);


    D1mat = zeros(nx,nz,dim);
    D2mat = zeros(nx,nz,dim);

    for i = 1:dim
        D1mat(:,:,i) = 2*fmat1.*(repmat(X(:,i),1,nz)-repmat(Z(:,i)',nx,1));
        D2mat(:,:,i) = 4*fmat2.*(repmat(X(:,i),1,nz)-repmat(Z(:,i)',nx,1)).^2 + 2*fmat1;
    end

    Dx = D1mat(:,:,1);
    Dy = D1mat(:,:,2);
    Dz = D1mat(:,:,3);
    
    Dxx = D2mat(:,:,1);
    Dyy = D2mat(:,:,2);
    Dzz = D2mat(:,:,3);


    Dxy = 4*fmat2.*(repmat(X(:,1),1,nz)-repmat(Z(:,1)',nx,1)).*(repmat(X(:,2),1,nz)-repmat(Z(:,2)',nx,1));
    Dxz = 4*fmat2.*(repmat(X(:,1),1,nz)-repmat(Z(:,1)',nx,1)).*(repmat(X(:,3),1,nz)-repmat(Z(:,3)',nx,1));
    Dyz = 4*fmat2.*(repmat(X(:,2),1,nz)-repmat(Z(:,2)',nx,1)).*(repmat(X(:,3),1,nz)-repmat(Z(:,3)',nx,1));





    syms x y z;
    switch surftype
        case 'Sphere' 
            % x^2 + y^2 + z^2 - R^2 = 0 
            cxx = matlabFunction((y^2+z^2)/(x^2+y^2+z^2));
            cyy = matlabFunction((x^2+z^2)/(x^2+y^2+z^2));
            czz = matlabFunction((x^2+y^2)/(x^2+y^2+z^2));
            cxy = matlabFunction(-2*x*y/(x^2+y^2+z^2));
            cyz = matlabFunction(-2*y*z/(x^2+y^2+z^2));
            cxz = matlabFunction(-2*x*z/(x^2+y^2+z^2));
            cx  = matlabFunction(-2*x/(x^2+y^2+z^2));
            cy  = matlabFunction(-2*y/(x^2+y^2+z^2));
            cz  = matlabFunction(-2*z/(x^2+y^2+z^2));
        case 'Torus'
            R = 1;
            r = 1/3;
            % (x^2 + y^2 + z^2 + R^2 - r^2)^2 - 4*R^2*(x^2 + y^2) = 0
            cxx = matlabFunction((y^6+(-2*R^2-2*r^2+2*x^2+3*z^2)*y^4+(3*z^4+(-4*r^2+4*x^2)*z^2+(R^2+r^2-x^2)^2)*y^2+z^2*(R^2-r^2+x^2+z^2)^2)/(y^6+(-2*R^2-2*r^2+3*x^2+3*z^2)*y^4+(3*z^4+(-4*r^2+6*x^2)*z^2+(R^2+r^2-x^2)*(R^2+r^2-3*x^2))*y^2+z^6+(2*R^2-2*r^2+3*x^2)*z^4+(3*x^4-4*r^2*x^2+(R-r)^2*(R+r)^2)*z^2+x^2*(R^2+r^2-x^2)^2));
            cyy = matlabFunction((x^6+(-2*R^2-2*r^2+2*y^2+3*z^2)*x^4+(3*z^4+(-4*r^2+4*y^2)*z^2+(R^2+r^2-y^2)^2)*x^2+z^2*(R^2-r^2+y^2+z^2)^2)/(x^6+(-2*R^2-2*r^2+3*y^2+3*z^2)*x^4+(3*z^4+(-4*r^2+6*y^2)*z^2+(R^2+r^2-y^2)*(R^2+r^2-3*y^2))*x^2+z^6+(2*R^2-2*r^2+3*y^2)*z^4+(3*y^4-4*r^2*y^2+(R-r)^2*(R+r)^2)*z^2+y^2*(R^2+r^2-y^2)^2));
            czz = matlabFunction((x^2+y^2)*(R^2+r^2-x^2-y^2-z^2)^2/(x^6+(-2*R^2-2*r^2+3*y^2+3*z^2)*x^4+(3*y^4+(-4*R^2-4*r^2+6*z^2)*y^2+3*z^4-4*r^2*z^2+(R^2+r^2)^2)*x^2+y^6+(-2*R^2-2*r^2+3*z^2)*y^4+(3*z^4-4*r^2*z^2+(R^2+r^2)^2)*y^2+z^2*(R^2-r^2+z^2)^2));
            cxy = matlabFunction(-2*x*(R^2+r^2-x^2-y^2-z^2)^2*y/(x^6+(-2*R^2-2*r^2+3*y^2+3*z^2)*x^4+(3*y^4+(-4*R^2-4*r^2+6*z^2)*y^2+3*z^4-4*r^2*z^2+(R^2+r^2)^2)*x^2+y^6+(-2*R^2-2*r^2+3*z^2)*y^4+(3*z^4-4*r^2*z^2+(R^2+r^2)^2)*y^2+z^2*(R^2-r^2+z^2)^2));
            cyz = matlabFunction(2*(R^2-r^2+x^2+y^2+z^2)*z*(R^2+r^2-x^2-y^2-z^2)*y/(x^6+(-2*R^2-2*r^2+3*y^2+3*z^2)*x^4+(3*y^4+(-4*R^2-4*r^2+6*z^2)*y^2+3*z^4-4*r^2*z^2+(R^2+r^2)^2)*x^2+y^6+(-2*R^2-2*r^2+3*z^2)*y^4+(3*z^4-4*r^2*z^2+(R^2+r^2)^2)*y^2+z^2*(R^2-r^2+z^2)^2));
            cxz = matlabFunction(2*x*(R^2+r^2-x^2-y^2-z^2)*(R^2-r^2+x^2+y^2+z^2)*z/(x^6+(-2*R^2-2*r^2+3*y^2+3*z^2)*x^4+(3*y^4+(-4*R^2-4*r^2+6*z^2)*y^2+3*z^4-4*r^2*z^2+(R^2+r^2)^2)*x^2+y^6+(-2*R^2-2*r^2+3*z^2)*y^4+(3*z^4-4*r^2*z^2+(R^2+r^2)^2)*y^2+z^2*(R^2-r^2+z^2)^2));
            cx  = matlabFunction(-2*x*(R^2+r^2-x^2-y^2-z^2)*(-x^8+(2*R^2+3*r^2-4*y^2-4*z^2)*x^6+(-6*y^4+(6*R^2+9*r^2-12*z^2)*y^2-6*z^4+(3*R^2+9*r^2)*z^2-R^4-4*R^2*r^2-3*r^4)*x^4+(-4*y^6+(6*R^2+9*r^2-12*z^2)*y^4+(-12*z^4+(6*R^2+18*r^2)*z^2-2*R^4-8*R^2*r^2-6*r^4)*y^2-4*z^6+9*r^2*z^4+(-4*R^4-2*R^2*r^2-6*r^4)*z^2+r^2*(R^2+r^2)^2)*x^2-y^8+(2*R^2+3*r^2-4*z^2)*y^6+(-6*z^4+(3*R^2+9*r^2)*z^2-R^4-4*R^2*r^2-3*r^4)*y^4+(-4*z^6+9*r^2*z^4+(-4*R^4-2*R^2*r^2-6*r^4)*z^2+r^2*(R^2+r^2)^2)*y^2+z^2*(R^2+r^2-z^2)*(R^2-r^2+z^2)^2)/(x^6+(-2*R^2-2*r^2+3*y^2+3*z^2)*x^4+(3*y^4+(-4*R^2-4*r^2+6*z^2)*y^2+3*z^4-4*r^2*z^2+(R^2+r^2)^2)*x^2+y^6+(-2*R^2-2*r^2+3*z^2)*y^4+(3*z^4-4*r^2*z^2+(R^2+r^2)^2)*y^2+z^2*(R^2-r^2+z^2)^2)^2);
            cy  = matlabFunction(-2*x*(R^2+r^2-x^2-y^2-z^2)*(-x^8+(2*R^2+3*r^2-4*y^2-4*z^2)*x^6+(-6*y^4+(6*R^2+9*r^2-12*z^2)*y^2-6*z^4+(3*R^2+9*r^2)*z^2-R^4-4*R^2*r^2-3*r^4)*x^4+(-4*y^6+(6*R^2+9*r^2-12*z^2)*y^4+(-12*z^4+(6*R^2+18*r^2)*z^2-2*R^4-8*R^2*r^2-6*r^4)*y^2-4*z^6+9*r^2*z^4+(-4*R^4-2*R^2*r^2-6*r^4)*z^2+r^2*(R^2+r^2)^2)*x^2-y^8+(2*R^2+3*r^2-4*z^2)*y^6+(-6*z^4+(3*R^2+9*r^2)*z^2-R^4-4*R^2*r^2-3*r^4)*y^4+(-4*z^6+9*r^2*z^4+(-4*R^4-2*R^2*r^2-6*r^4)*z^2+r^2*(R^2+r^2)^2)*y^2+z^2*(R^2+r^2-z^2)*(R^2-r^2+z^2)^2)/(x^6+(-2*R^2-2*r^2+3*y^2+3*z^2)*x^4+(3*y^4+(-4*R^2-4*r^2+6*z^2)*y^2+3*z^4-4*r^2*z^2+(R^2+r^2)^2)*x^2+y^6+(-2*R^2-2*r^2+3*z^2)*y^4+(3*z^4-4*r^2*z^2+(R^2+r^2)^2)*y^2+z^2*(R^2-r^2+z^2)^2)^2);
            cz  = matlabFunction(2*z*(R^2-r^2+x^2+y^2+z^2)*(-x^8+(2*R^2+3*r^2-4*y^2-4*z^2)*x^6+(-6*y^4+(6*R^2+9*r^2-12*z^2)*y^2-6*z^4+(3*R^2+9*r^2)*z^2-R^4-4*R^2*r^2-3*r^4)*x^4+(-4*y^6+(6*R^2+9*r^2-12*z^2)*y^4+(-12*z^4+(6*R^2+18*r^2)*z^2-2*R^4-8*R^2*r^2-6*r^4)*y^2-4*z^6+9*r^2*z^4+(-4*R^4-2*R^2*r^2-6*r^4)*z^2+r^2*(R^2+r^2)^2)*x^2-y^8+(2*R^2+3*r^2-4*z^2)*y^6+(-6*z^4+(3*R^2+9*r^2)*z^2-R^4-4*R^2*r^2-3*r^4)*y^4+(-4*z^6+9*r^2*z^4+(-4*R^4-2*R^2*r^2-6*r^4)*z^2+r^2*(R^2+r^2)^2)*y^2+z^2*(R^2+r^2-z^2)*(R^2-r^2+z^2)^2)/(x^6+(-2*R^2-2*r^2+3*y^2+3*z^2)*x^4+(3*y^4+(-4*R^2-4*r^2+6*z^2)*y^2+3*z^4-4*r^2*z^2+(R^2+r^2)^2)*x^2+y^6+(-2*R^2-2*r^2+3*z^2)*y^4+(3*z^4-4*r^2*z^2+(R^2+r^2)^2)*y^2+z^2*(R^2-r^2+z^2)^2)^2);
        case 'Bretzel2'
            % (-x^4 + x^2 - y^2)^2 + z^2/2 - (x^2 + y^2 + z^2 + 1)/40 = 0
            cxx = matlabFunction((6400*x^8*y^2-12800*x^6*y^2+(12800*y^4+6240*y^2)*x^4+(-12800*y^4+160*y^2)*x^2+6400*y^6-160*y^4+y^2+361*z^2)/(25600*x^14-76800*x^12+(51200*y^2+83200)*x^10+(-96000*y^2-38720)*x^8+(25600*y^4+51200*y^2+6880)*x^6+(-12800*y^4-6880*y^2-160)*x^4+(-6400*y^4+320*y^2+1)*x^2+6400*y^6-160*y^4+y^2+361*z^2));
            cyy = matlabFunction((25600*x^14-76800*x^12+(51200*y^2+83200)*x^10+(-102400*y^2-38720)*x^8+(25600*y^4+64000*y^2+6880)*x^6+(-25600*y^4-13120*y^2-160)*x^4+6400*(y^2+1/80)^2*x^2+361*z^2)/(25600*x^14-76800*x^12+(51200*y^2+83200)*x^10+(-96000*y^2-38720)*x^8+(25600*y^4+51200*y^2+6880)*x^6+(-12800*y^4-6880*y^2-160)*x^4+(-6400*y^4+320*y^2+1)*x^2+6400*y^6-160*y^4+y^2+361*z^2));
            czz = matlabFunction(655360000*(x^14-3*x^12+(2*y^2+13/4)*x^10+(-15/4*y^2-121/80)*x^8+(43/160+2*y^2+y^4)*x^6+(-1/2*y^4-43/160*y^2-1/160)*x^4+(1/80*y^2+1/25600-1/4*y^4)*x^2+1/4*y^6-1/160*y^4+1/25600*y^2+361/25600*z^2)*(x^14-3*x^12+(2*y^2+13/4)*x^10+(-15/4*y^2-121/80)*x^8+(43/160+2*y^2+y^4)*x^6+(-1/2*y^4-43/160*y^2-1/160)*x^4+(1/80*y^2+1/25600-1/4*y^4)*x^2+1/4*y^2*(y^2-1/80)^2)/(25600*x^14-76800*x^12+51200*x^10*y^2+83200*x^10-96000*x^8*y^2+25600*x^6*y^4-38720*x^8+51200*x^6*y^2-12800*x^4*y^4+6880*x^6-6880*x^4*y^2-6400*x^2*y^4+6400*y^6-160*x^4+320*x^2*y^2-160*y^4+x^2+y^2+361*z^2)^2);
            cxy = matlabFunction(-655360000*(x^14-3*x^12+(2*y^2+13/4)*x^10+(-15/4*y^2-121/80)*x^8+(43/160+2*y^2+y^4)*x^6+(-1/2*y^4-43/160*y^2-1/160)*x^4+(1/80*y^2+1/25600-1/4*y^4)*x^2+1/4*y^6-1/160*y^4+1/25600*y^2+361/25600*z^2)*(x^6-3/2*x^4+(y^2+1/2)*x^2-1/2*y^2-1/160)*y*x*(x^4-x^2+y^2-1/80)/(25600*x^14-76800*x^12+51200*x^10*y^2+83200*x^10-96000*x^8*y^2+25600*x^6*y^4-38720*x^8+51200*x^6*y^2-12800*x^4*y^4+6880*x^6-6880*x^4*y^2-6400*x^2*y^4+6400*y^6-160*x^4+320*x^2*y^2-160*y^4+x^2+y^2+361*z^2)^2);
            cyz = matlabFunction(-77824000*z*(x^14-3*x^12+(2*y^2+13/4)*x^10+(-15/4*y^2-121/80)*x^8+(43/160+2*y^2+y^4)*x^6+(-1/2*y^4-43/160*y^2-1/160)*x^4+(1/80*y^2+1/25600-1/4*y^4)*x^2+1/4*y^6-1/160*y^4+1/25600*y^2+361/25600*z^2)*y*(x^4-x^2+y^2-1/80)/(25600*x^14-76800*x^12+51200*x^10*y^2+83200*x^10-96000*x^8*y^2+25600*x^6*y^4-38720*x^8+51200*x^6*y^2-12800*x^4*y^4+6880*x^6-6880*x^4*y^2-6400*x^2*y^4+6400*y^6-160*x^4+320*x^2*y^2-160*y^4+x^2+y^2+361*z^2)^2);
            cxz = matlabFunction(-155648000*(x^6-3/2*x^4+(y^2+1/2)*x^2-1/2*y^2-1/160)*x*(x^14-3*x^12+(2*y^2+13/4)*x^10+(-15/4*y^2-121/80)*x^8+(y^4+2*y^2+43/160)*x^6+(-1/2*y^4-43/160*y^2-1/160)*x^4+(-1/4*y^4+1/80*y^2+1/25600)*x^2+1/4*y^6-1/160*y^4+1/25600*y^2+361/25600*z^2)*z/(25600*x^14-76800*x^12+51200*x^10*y^2+83200*x^10-96000*x^8*y^2+25600*x^6*y^4-38720*x^8+51200*x^6*y^2-12800*x^4*y^4+6880*x^6-6880*x^4*y^2-6400*x^2*y^4+6400*y^6-160*x^4+320*x^2*y^2-160*y^4+x^2+y^2+361*z^2)^2);
            cx  = matlabFunction(-327680000*(x^18-4*x^16+(259/40+9/2*y^2)*x^14+(-87/16-55/4*y^2)*x^12+(1233/80*y^2+201/80+15/2*y^4)*x^10+(-603/80*y^2-1969/3200-63/4*y^4)*x^8+(18407/12800*y^2+99/10*y^4+1709/25600+11/2*y^6+2527/12800*z^2)*x^6+(-123/80*y^4-1731/25600*y^2-37/25600-25/4*y^6-2527/12800*z^2)*x^4+(3/2*y^8+77/80*y^6-797/12800*y^4+(41/12800+1083/12800*z^2)*y^2+9/1024000+361/12800*z^2)*x^2-1/4*(y^6-19/80*y^4+9/3200*y^2-361/3200*z^2)*(y^2-1/80))*(x^6-3/2*x^4+(y^2+1/2)*x^2-1/2*y^2-1/160)*x/(25600*x^14-76800*x^12+51200*x^10*y^2+83200*x^10-96000*x^8*y^2+25600*x^6*y^4-38720*x^8+51200*x^6*y^2-12800*x^4*y^4+6880*x^6-6880*x^4*y^2-6400*x^2*y^4+6400*y^6-160*x^4+320*x^2*y^2-160*y^4+x^2+y^2+361*z^2)^2);
            cy  = matlabFunction(-327680000*(x^18-4*x^16+(259/40+9/2*y^2)*x^14+(-87/16-55/4*y^2)*x^12+(1233/80*y^2+201/80+15/2*y^4)*x^10+(-603/80*y^2-1969/3200-63/4*y^4)*x^8+(18407/12800*y^2+99/10*y^4+1709/25600+11/2*y^6+2527/12800*z^2)*x^6+(-123/80*y^4-1731/25600*y^2-37/25600-25/4*y^6-2527/12800*z^2)*x^4+(3/2*y^8+77/80*y^6-797/12800*y^4+(41/12800+1083/12800*z^2)*y^2+9/1024000+361/12800*z^2)*x^2-1/4*(y^6-19/80*y^4+9/3200*y^2-361/3200*z^2)*(y^2-1/80))*(x^6-3/2*x^4+(y^2+1/2)*x^2-1/2*y^2-1/160)*x/(25600*x^14-76800*x^12+51200*x^10*y^2+83200*x^10-96000*x^8*y^2+25600*x^6*y^4-38720*x^8+51200*x^6*y^2-12800*x^4*y^4+6880*x^6-6880*x^4*y^2-6400*x^2*y^4+6400*y^6-160*x^4+320*x^2*y^2-160*y^4+x^2+y^2+361*z^2)^2);
            cz  = matlabFunction(-38912000*(x^18-4*x^16+(259/40+9/2*y^2)*x^14+(-87/16-55/4*y^2)*x^12+(1233/80*y^2+201/80+15/2*y^4)*x^10+(-603/80*y^2-1969/3200-63/4*y^4)*x^8+(18407/12800*y^2+99/10*y^4+1709/25600+11/2*y^6+2527/12800*z^2)*x^6+(-123/80*y^4-1731/25600*y^2-37/25600-25/4*y^6-2527/12800*z^2)*x^4+(3/2*y^8+77/80*y^6-797/12800*y^4+(41/12800+1083/12800*z^2)*y^2+9/1024000+361/12800*z^2)*x^2-1/4*(y^6-19/80*y^4+9/3200*y^2-361/3200*z^2)*(y^2-1/80))*z/(25600*x^14-76800*x^12+51200*x^10*y^2+83200*x^10-96000*x^8*y^2+25600*x^6*y^4-38720*x^8+51200*x^6*y^2-12800*x^4*y^4+6880*x^6-6880*x^4*y^2-6400*x^2*y^4+6400*y^6-160*x^4+320*x^2*y^2-160*y^4+x^2+y^2+361*z^2)^2);
