    Pxx = cxx(X(:,1),X(:,2),X(:,3));
    Pyy = cyy(X(:,1),X(:,2),X(:,3));
    Pzz = czz(X(:,1),X(:,2),X(:,3));
    Pxy = cxy(X(:,1),X(:,2),X(:,3));
    Pyz = cyz(X(:,1),X(:,2),X(:,3));
    Pxz = cxz(X(:,1),X(:,2),X(:,3));
    Px  = cx (X(:,1),X(:,2),X(:,3));
    Py  = cy (X(:,1),X(:,2),X(:,3));
    Pz  = cz (X(:,1),X(:,2),X(:,3));


    surflap = Dxx.*Pxx + Dyy.*Pyy + Dzz.*Pzz +...
              Dxy.*Pxy + Dyz.*Pyz + Dxz.*Pxz +...
              Dx .*Px  + Dy .*Py  + Dz .*Pz;

    if nargin == 3
        surfgrad = []; 
        return;
    end


    switch surftype
        case 'Sphere' 
            R = 1;
            shape_f = @(x, y, z) x.^2 + y.^2 + z.^2 - R.^2;
        case 'Torus'
            R = 1;
            r = 1/3;
            shape_f = @(x, y, z) (x.^2 + y.^2 + z.^2 + R.^2 - r.^2).^2 - 4*R.^2.*(x.^2 + y.^2);
        case 'Bretzel2'
            shape_f = @(x, y, z) (-x.^4 + x.^2 - y.^2).^2 + z.^2/2 - (x.^2 + y.^2 + z.^2 + 1)/40;
        case 'Cyclide' 
            shape_f = @(x, y, z) (x.^2 + y.^2 + z.^2 - 1 + 19^2/100).^2 - 4*(2*x + sqrt(4 - 19^2/100)).^2 - (4*(19*y).^2)/100;
        case 'CPD surface'
            shape_f = @(x, y, z) sqrt((x - 1).^2 + y.^2 + z.^2).*sqrt((x + 1).^2 + y.^2 + z.^2).*sqrt((y - 1).^2 + x.^2 + z.^2).*sqrt((y + 1).^2 + x.^2 + z.^2) - 1.1;
        case 'orthocircle'
            shape_f = @(x, y, z) ((x.^2 + y.^2 - 1).^2 + z.^2).*((y.^2 + z.^2 - 1).^2 + x.^2).*((x.^2 + z.^2 - 1).^2 + y.^2) - 0.075.^2.*(1 + 3.*(x.^2 + y.^2 + z.^2));
        otherwise
            error('surface type not implemented');    
    end
    N1 = diff(shape_f, x);
    N2 = diff(shape_f, y);
    N3 = diff(shape_f, z);
    N = cell(3,1);
    N{1} = N1./sqrt(N1^2 + N2^2 + N3^2);
    N{2} = N2./sqrt(N1^2 + N2^2 + N3^2);
    N{3} = N3./sqrt(N1^2 + N2^2 + N3^2);



    
    Iden_mat = eye(dim);
    P = cell(dim, dim);
    for i = 1: dim
        for j = 1: dim
            P{i, j} = Iden_mat(i,j) - N{i}* N{j};
        end
    end
    
    Pij{1,1}=matlabFunction(P{1,1});
    Pij{1,2}=matlabFunction(P{1,2});
    Pij{1,3}=matlabFunction(P{1,3});
    Pij{2,2}=matlabFunction(P{2,2});
    Pij{2,3}=matlabFunction(P{2,3});
    Pij{3,3}=matlabFunction(P{3,3});
    
    for i1=1:3
        for j=i1:3   
            Pij_i1j=Pij{i1,j}(X(:,1),X(:,2),X(:,3));
            Pij{i1,j}=sparse(length(Pij_i1j),length(Pij_i1j));
            for k_i1j=1:length(Pij_i1j)
                Pij{i1,j}(k_i1j,k_i1j)=Pij_i1j(k_i1j);
            end
        end
    end
    surfgrad(:,:,1) = (Pij{1,1})*Dx + (Pij{1,2})*Dy + (Pij{1,3})*Dz;
    surfgrad(:,:,2) = (Pij{1,2})*Dx + (Pij{2,2})*Dy + (Pij{2,3})*Dz;
    surfgrad(:,:,3) = (Pij{1,3})*Dx + (Pij{2,3})*Dy + (Pij{3,3})*Dz;

elseif dim == 2

    [nz,dim] = size(Z);
    nx = size(X,1);

    DMS = DistanceMatrixSquare(X,Z);
    IM = frbf(DMS*diag(RBFscale.^2),0);
    fmat1 = frbf(DMS*diag(RBFscale.^2),1)*diag(RBFscale.^2);
    fmat2 = frbf(DMS*diag(RBFscale.^2),2)*diag(RBFscale.^4);
    
    
    D1mat = zeros(nx,nz,dim);
    D2mat = zeros(nx,nz,dim);
    
    for i = 1:dim
        D1mat(:,:,i) = 2*fmat1.*(repmat(X(:,i),1,nz)-repmat(Z(:,i)',nx,1));
        D2mat(:,:,i) = 4*fmat2.*(repmat(X(:,i),1,nz)-repmat(Z(:,i)',nx,1)).^2+2*fmat1;
    end
    
    Dx = D1mat(:,:,1);
    Dy = D1mat(:,:,2);
    Dxx = D2mat(:,:,1);
    Dyy = D2mat(:,:,2);
    Dxy = 4*fmat2.*(repmat(X(:,1),1,nz)-repmat(Z(:,1)',nx,1)).*(repmat(X(:,2),1,nz)-repmat(Z(:,2)',nx,1));
    
    
    
    syms x y;
    switch surftype
        case 'Circle' 
            % x^2 + y^2 - R^2 = 0;
            cxx = matlabFunction(y^2/(x^2+y^2));
            cyy = matlabFunction(x^2/(x^2+y^2));
            cxy = matlabFunction(-2*x*y/(x^2+y^2));
            cx  = matlabFunction(-x/(x^2+y^2));
            cy  = matlabFunction(-y/(x^2+y^2));  
    end
    
    Pxx = cxx(X(:,1),X(:,2));
    Pyy = cyy(X(:,1),X(:,2));
    Pxy = cxy(X(:,1),X(:,2));
    Px  = cx (X(:,1),X(:,2));
    Py  = cy (X(:,1),X(:,2));
    
    
    
    surflap = Dxx.*Pxx + Dyy.*Pyy + ...
              Dxy.*Pxy  + ...
              Dx .*Px  + Dy .*Py;

    if nargin == 3
        surfgrad = []; 
        return;
    end
    
    switch surftype
        case 'Circle' 
            R = 1;
            shape_f = @(x, y) x.^2 + y.^2 - R.^2;
    end
    N1 = diff(shape_f, x);
    N2 = diff(shape_f, y);

    N = cell(2,1);
    N{1} = N1./sqrt(N1^2 + N2^2);
    N{2} = N2./sqrt(N1^2 + N2^2);
 
    Iden_mat = eye(dim);
    P = cell(dim, dim);
    for i = 1: dim
        for j = 1: dim
            P{i, j} = Iden_mat(i,j) - N{i}* N{j};
        end
    end
    
    Pij{1,1}=matlabFunction(P{1,1});
    Pij{1,2}=matlabFunction(P{1,2});
    Pij{2,2}=matlabFunction(P{2,2});

    
    for i1=1:dim
        for j=i1:dim 
            Pij_i1j=Pij{i1,j}(X(:,1),X(:,2));
            Pij{i1,j}=sparse(length(Pij_i1j),length(Pij_i1j));
            for k_i1j=1:length(Pij_i1j)
                Pij{i1,j}(k_i1j,k_i1j)=Pij_i1j(k_i1j);
            end
        end
    end
    surfgrad(:,:,1) = (Pij{1,1})*Dx + (Pij{1,2})*Dy;
    surfgrad(:,:,2) = (Pij{1,2})*Dx + (Pij{2,2})*Dy;
else
    error('space dimension not implemented')
end
